import manageJss from "@microsoft/fast-jss-manager-react";
import { AutoSuggestStyles } from "@microsoft/fast-components-styles-msft";
import MSFTAutoSuggest from "./auto-suggest";
import autoSuggestSchema from "./auto-suggest.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const AutoSuggest = manageJss(AutoSuggestStyles)(MSFTAutoSuggest);
export { AutoSuggest, autoSuggestSchema, };
